Text:
Excelente entrevista de dos grandes, de nuestro precioso EL SALVADOR;
Nuestro presidente, Nayib Bukele y nuestro héroe, Frank Rubio; 
Qué; tanto como nuestro presidente, él uno como el otro; han puesto en alto nuestro país.
Bendiciones para ambos.

English Text (Google Translate):
Excellent interview of two greats, from our beautiful EL SALVADOR;
Our president, Nayib Bukele and our hero, Frank Rubio;
That; as much as our president, he one as the other; They have elevated our country.
Blessings to both of you.
